To use the phantom in OpenSCAD, use:
import ;
yubikey();
Repeat calls of yubikey() when you need more copies.
If you use them as support in a case/holder print you may want to lubricate them so they don't get stuck. I rubbed them with some wax. You can usually find it in the baking/canning section of the grocery store. The brand they have at Wal-Mart is called Gulf Wax.
